<!DOCTYPE html>
<html>
<head>
<meta charset='utf-8'>
<style TYPE='text/css'>
body {
	background-color: #252525;
	color: #e8e8e8
}

.highlighter .add { 
	background-color: #1c7b50;
}

.highlighter .remove { 
	background-color: #80372b;
}

.highlighter td.modify { 
	background-color: #2c5075;
}

.highlighter td.conflict { 
	background-color: #c72c41;
}

.highlighter .spec { 
	background-color: #505050;
}

.highlighter .move { 
	background-color: #353535;
}

.highlighter .null { 
	color: #666;
}

.highlighter table { 
	border-collapse:collapse;
}

.highlighter td, .highlighter th {
	border: 1px solid #444;
	padding: 3px 7px 2px;
}

.highlighter th, .highlighter .header, .highlighter .meta {
	background-color: #636363;
	font-weight: bold;
	padding-bottom: 4px;
	padding-top: 5px;
	text-align:left;
}

.highlighter tr.header th {
	border-bottom: 2px solid black;
}

.highlighter tr.index td, .highlighter .index, .highlighter tr.header th.index {
	background-color: #4a4a4a;
	border: none;
}

.highlighter .gap {
	color: #666;
}

.highlighter td {
	empty-cells: show;
	white-space: pre-wrap;
}
</style>
</head>
<body>
<div class='highlighter'>
<table>
<thead>
<tr class="header"><th>@@</th><th>﻿key: int32</th><th>0: byte</th><th>1: str</th></tr>
</thead>
<tbody>
<tr class="gap"><td>...</td><td>...</td><td>...</td><td>...</td></tr>
<tr><td></td><td>1</td><td>1</td><td>Minions</td></tr>
<tr class="modify"><td class="modify">→</td><td>2</td><td class="modify">5→40</td><td>Speech Bubbles</td></tr>
<tr class="modify"><td class="modify">→</td><td>3</td><td class="modify">7→60</td><td>Emotes</td></tr>
<tr class="modify"><td class="modify">→</td><td>4</td><td class="modify">3→20</td><td>Triple Triad</td></tr>
<tr><td></td><td>5</td><td>100</td><td>General</td></tr>
<tr class="modify"><td class="modify">→</td><td>6</td><td class="modify">2→10</td><td>Flags</td></tr>
<tr class="modify"><td class="modify">→</td><td>7</td><td class="modify">6→31</td><td>Punctuation Marks</td></tr>
<tr class="modify"><td class="modify">→</td><td>8</td><td class="modify">8→70</td><td>Meals</td></tr>
<tr class="modify"><td class="modify">→</td><td>9</td><td class="modify">4→30</td><td>Decorations</td></tr>
<tr><td></td><td>10</td><td>102</td><td>Duty</td></tr>
<tr class="gap"><td>...</td><td>...</td><td>...</td><td>...</td></tr>
<tr><td></td><td>15</td><td>0</td><td></td></tr>
<tr class="add"><td>+++</td><td>16</td><td>105</td><td>Logos</td></tr>
<tr class="add"><td>+++</td><td>17</td><td>32</td><td>Manga</td></tr>
<tr class="add"><td>+++</td><td>18</td><td>71</td><td>Medicine</td></tr>
<tr class="add"><td>+++</td><td>19</td><td>50</td><td>Quest Icons</td></tr>
<tr class="add"><td>+++</td><td>20</td><td>80</td><td>Doodles</td></tr>
</tbody>
</table>
</div>
</body>
</html>
